import React, { Component, useState } from 'react';
import TodoSubList from './todosublist'
import "../App.css"
import { Grid } from '@material-ui/core'

const TodoList = (props) => {

    //set up state from app.js

    //Lets return a div with ul with what is inside the state

    let mapper = props.map(input =>
        <div>
            <Grid
                container
                direction="Column"
                justify="center"
                alignItems="center"
            >
                <li>
                    {input.task}
                </li>
                <li>
                    {input.dateB}
                </li>
                <li>
                    {input.dateE}
                </li>
                <li>
                    {input.completed}
                </li>
            </Grid>
            <li>
                {input.steps.length > 0 && TodoSubList(input.steps)}
            </li>
        </div>
    )
    let content = (
        <div>
            <ul>
                {mapper}
            </ul>
        </div>
    )
    return content
}


export default TodoList;
